import React, { useState } from "react";
import { VscThreeBars } from "react-icons/vsc"

import * as S from "./styled";

export default function Header(){
    const [mod, setMod] = useState(false)
    return(
        <S.ContHeader>
                <S.ContNav>
                    <h2>RC</h2>
                    <S.Navegation>
                        <S.List>
                            <li>ABOUT</li>
                            <li>RECIPES</li>
                            <li>SUBSCRIBE</li>
                        </S.List>
                        <S.Menu onClick={()=>setMod(true)}/>
                        {!!mod}
                    </S.Navegation>
                </S.ContNav>
            <S.ContRecipes>
                <h1>RECIPES</h1>
            </S.ContRecipes>
        </S.ContHeader>
    )
}
